response.about:
Розумна, весела, енергійна, практична, романтична, комунікабельна, цілеспрямована.
Правда -  синонім краси.
Основними для мене є три життєвих креда:
1.  "Если стоит что-то делать, то только хорошо";
2.  Не треба сприймати окрему невдачу, як цілковиту     поразку;
3.  "От добра добра не ищут".
